import React, {useState, useEffect} from 'react'
import {Router, browserRoute} from 'react-router'

function Navbar(){

  return(
    <Router>
      <li><Router to="/">Home</Router></li>
      <li><a href="/blog">Blog</a></li>
      <li><a href="/contact">Contact</a></li>
    </Router>
  )
}

export default Navbar
